        let currentIndex = 0;
        const batchSize = 10;

        // Fisher-Yates shuffle algorithm
        function shuffleArray(array) {
            for (let i = array.length - 1; i > 0; i--) {
                const j = Math.floor(Math.random() * (i + 1));
                [array[i], array[j]] = [array[j], array[i]];
            }
        }

        // Function to create and append images
function displayImages(start, end) {
    const container = document.getElementById('imageContainer');
    
    for (let i = start; i < end && i < imageSources.length; i++) {
        const img = document.createElement('img');
        img.src = imageSources[i];
        img.alt = 'Random image';
        img.onerror = function() {
            console.log('Failed to load image:', imageSources[i]);
            this.style.display = 'none'; // Hide the broken image
        };
        container.appendChild(img);
    }
}

        // Function to check scroll position and load more images if needed
        function checkScroll() {
            const container = document.getElementById('imageContainer');
            const images = container.getElementsByTagName('img');
            const lastImage = images[images.length - 4]; // 7th from last

            if (lastImage && lastImage.getBoundingClientRect().bottom <= window.innerHeight) {
                currentIndex += batchSize;
                displayImages(currentIndex, currentIndex + batchSize);
            }
        }

        // Initialize the gallery
        function initGallery() {
            shuffleArray(imageSources);
            displayImages(0, batchSize);
            window.addEventListener('scroll', checkScroll);
        }

        // Call the function when the page loads
        window.onload = initGallery;
    </script>
